import requests, re, threading, os

def getHtml(url):
    return requests.get(url).text

def getData(html):
    line_segment_re = re.compile(r'<g class="day-hovers">(.*?)</g>')
    x_re = re.compile(r'x="(.*?)"')
    y_re = re.compile(r'y="(.*?)"')
    x_axis_re = re.compile(r'<g class="axis x"(.*?)telebears</text></g>')
    y_axis_re = re.compile(r'<g class="axis y">(.*?)Enrolled</text></g>')
    x_coord_re = re.compile(r'transform="translate\((.*?),0\)" style=')
    y_coord_re = re.compile(r'transform="translate\(0,(.*?)\)" style=')
    x_label_re = re.compile(r'middle;">(.*?)</text>')
    y_label_re = re.compile(r'end;">(.*?)</text>')

    phase_1_re = re.compile(r'<g class="indicator phase1">.*?x="(.*?)".*?Phase I \(')
    phase_2_re = re.compile(r'<g class="indicator phase2">.*?x="(.*?)".*?Phase II \(')
    adjust_re = re.compile(r'<g class="indicator adjustment">.*?x="(.*?)".*?Adjustment Period \(')

    x_lists = [x_re.findall(line) for line in line_segment_re.findall(html)]
    y_lists = [y_re.findall(line) for line in line_segment_re.findall(html)]
    x_axis, y_axis = x_axis_re.findall(html)[0], y_axis_re.findall(html)[0]
    x_labels, y_labels = x_label_re.findall(x_axis), y_label_re.findall(y_axis)
    x_label_coords, y_label_coords = x_coord_re.findall(x_axis)[1:], y_coord_re.findall(y_axis)
    x_lists = [[float(x) for x in list] for list in x_lists]
    y_lists = [[float(y) for y in list] for list in y_lists]
    max_x = float(x_labels[-1])
    try:
        max_y = float(y_labels[-1])
    except:
        try:
            max_y = float(y_labels[-1][:-1]) / 100
        except:
            max_y = float(y_labels[-2][:-1]) / 100
    max_x_coord, max_y_coord = float(x_label_coords[-1]), float(y_label_coords[0])
    x_scale, y_scale = max_x / max_x_coord, max_y / max_y_coord
    data = [[[round(x * x_scale), (max_y_coord - y) * y_scale] for x, y in zip(x_list, y_list)] for x_list, y_list in zip(x_lists, y_lists)]

    phase_1 = round(float(phase_1_re.search(html).group(1)) * x_scale)
    phase_2 = round(float(phase_2_re.search(html).group(1)) * x_scale)
    adjust = round(float(adjust_re.search(html).group(1)) * x_scale)

    return data, phase_1, phase_2, adjust


